-- ----------------------------
-- View structure for complaints_view
-- ----------------------------
DROP VIEW IF EXISTS `complaints_view`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `complaints_view` AS SELECT
	cmp.id,
	cmp.complaint_no,
	type.complaint_type_id,
	type.complaint_name,
	IFNULL(shop.shop_name,'-') as shop_name,
	IFNULL(shop.shop_no,'-') as shop_no,
	IFNULL(shop.address,'-') as address,
	cmp.mobile_no,
	IFNULL(cmp.ward_no,asst.ward_no) as ward_no,
	IFNULL(cmp.street_no,asst.street_no) as street_no,
	IFNULL(cmp.door_no,asst.door_no) as door_no,
	IFNULL(cmp.name,asst.owner_name) as name,
	IFNULL(cmp.SMS,'-') as sms,
	cmp.description,
	sts.status_name,
	cmp.status_id,
	DATE_FORMAT( cmp.created_at, '%d-%m-%Y' ) AS complaint_date,
	DATE_FORMAT( cmp.created_at, '%d-%m-%Y %h:%i %p' ) AS complaint_datetime,
	cmp.created_at 
FROM
	complaints AS cmp
	LEFT JOIN complaint_types AS type ON type.complaint_type_id = cmp.complaint_type_id
	LEFT JOIN complaint_statuses AS sts ON sts.status_id = cmp.status_id 
	LEFT JOIN assessment AS asst ON asst.mobile_no = cmp.mobile_no 
	LEFT JOIN covid_shop AS shop ON shop.shop_id = cmp.shop_id 
	order by cmp.id desc ;

-- ----------------------------
-- View structure for complaint_table_view
-- ----------------------------
DROP VIEW IF EXISTS `complaint_table_view`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `complaint_table_view` AS SELECT
	cmp.id,
	cmp.complaint_no,
	type.complaint_type_id,
	type.complaint_name,
	IFNULL(shop.shop_name,'-') as shop_name,
	IFNULL(shop.shop_no,'-') as shop_no,
	IFNULL(shop.address,'-') as address,
	cmp.mobile_no,
	IFNULL(cmp.SMS,'-') as sms,
	cmp.ward_no,
	cmp.street_no,
	cmp.door_no,
	cmp.name,
	cmp.description,
	sts.status_name,
	cmp.status_id,
	DATE_FORMAT( cmp.created_at, '%d-%m-%Y' ) AS complaint_date,
	DATE_FORMAT( cmp.created_at, '%d-%m-%Y %h:%i %p' ) AS complaint_datetime,
	cmp.created_at 
FROM
	complaints AS cmp
	LEFT JOIN complaint_types AS type ON type.complaint_type_id = cmp.complaint_type_id
	LEFT JOIN complaint_statuses AS sts ON sts.status_id = cmp.status_id 
	LEFT JOIN covid_shop AS shop ON shop.shop_id = cmp.shop_id
order by 	cmp.id desc ;

-- ----------------------------
-- View structure for covid_config_view
-- ----------------------------
DROP VIEW IF EXISTS `covid_config_view`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `covid_config_view` AS SELECT
	config.shop_id,
	config.category_id,
	config.shop_name,
	config.address,
	config.shop_no,
	cat.category_name,
	config.created_at 
FROM
	covid_shop AS config
	LEFT JOIN covid19_shop_category AS cat ON cat.category_id = config.category_id 
	order by config.shop_id desc ;

-- ----------------------------
-- View structure for sms_history_view
-- ----------------------------
DROP VIEW IF EXISTS `sms_history_view`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `sms_history_view` AS SELECT
	`sms_id`,
	`complaint_no`,
	`user_type`,
	`category`,
	`mobile_no`,
	`message`,
	DATE_FORMAT( created_at, '%d-%m-%Y %h:%i %p' ) AS sms_datetime,
	`updated_at` 
FROM
	`sms_history`
ORDER BY `sms_id` desc ;

